import React, { useState } from "react";
import Modal from "./Modal";

export default function ModalData() {
  const [data, setData] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [fData, setFData] = useState({
    name: "",
    email: "",
    contact: "",
    address: "",
    city: "",
    gender: "",
    hobby: "",
    age: "",
  });
  const [ferrors, setFerrors] = useState({
    name: "",
    email: "",
    contact: "",
    address: "",
    city: "",
    gender: "",
    hobby: "",
    age: "",
  });

  const handelChang = (event) => {
    setFData({
      ...fData,
      [event.target.name]: event.target.value,
    });
  };

  const handelSubmit = (event) => {
    // event.preventDefault();

    const errors = {};

    if (!fData.name || !/^[a-zA-Z\s]+$/.test(fData.name)) {
      errors.name = "Please enter a valid name";
    }
    if (!fData.email || !/^[\w-.]+@([\w-]+\.)+[\w-]{2,4}$/.test(fData.name)) {
      errors.email = "Please enter a valid name";
    }
    if (!fData.contact || !/^\d{10}$/.test(fData.contact)) {
      errors.contact = "Please enter a valid name";
    }
    if (!fData.address || !/^[a-zA-Z0-9\s,'-]*$/.test(fData.address)) {
      errors.address = "Please enter a valid name";
    }
    if (!fData.city) {
      errors.city = "Please enter a valid city name";
    }
    if (
      !fData.gender ||
      !fData.gender === "male" ||
      fData.gender === "female" ||
      fData.gender === "other"
    ) {
      errors.gender = "Please enter a valid gender";
    }

    if (!fData.age || !/^\d{1,3}$/.test(fData.age)) {
      errors.age = "Please enter a valid age between 1 and 150";
    }

    if (Object.keys(errors).length > 0) {
      setFerrors(errors);
    } else {
      setData([
        ...data,
        {
          name: fData.name,
          email: fData.email,
          contact: fData.contact,
          address: fData.address,
          city: fData.city,
          gender: fData.gender,
          hobby: fData.hobby,
          age: fData.age,
        },
      ]);

      setFData({
        name: "",
        email: "",
        contact: "",
        address: "",
        city: "",
        gender: "",
        hobby: "",
        age: "",
      });

      setFerrors({
        name: "",
        email: "",
        contact: "",
        address: "",
        city: "",
        gender: "",
        hobby: "",
        age: "",
      });

      setShowModal(false);
    }
  };

  return (
    <div>
      <div className="modal-1">
        <div className="modal-content">
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Contact</th>
                <th>Address</th>
                <th>City</th>
                <th>Gender</th>
                <th>Hobby</th>
                <th>Age</th>
                <th>
                  <button onClick={setShowModal(true)}>chgvh</button>
                </th>
              </tr>
            </thead>
            <tbody>
              {data.map((row, index) => (
                <tr key={index}>
                  <td>{row.name}</td>
                  <td>{row.email}</td>
                  <td>{row.contact}</td>
                  <td>{row.city}</td>
                  <td>{row.gender}</td>
                  <td>{row.hobby}</td>
                  <td>{row.age}</td>
                  <td>
                    <button>Edit</button>
                    <button>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
          {showModal && (
            <Modal
              handelChang={handelChang}
              fData={fData}
              handelSubmit={handelSubmit}
              setShowModal={setShowModal}
              ferrors={ferrors}
              setFerrors={setFerrors}
            />
          )}
        </div>
      </div>
    </div>
  );
}
